import React, { useEffect, useState } from 'react';
import './Schedules.css';

function Schedules() {
    const [schedules, setSchedules] = useState([]);
    const [newSchedule, setNewSchedule] = useState({
        name: '',
        description: '',
        url: '',
        cronExpression: '',
        method: 'GET',
        headers: '',
        body: ''
    });

    useEffect(() => {
        fetchSchedules();
    }, []);

    const fetchSchedules = async () => {
        try {
            const response = await fetch('http://localhost:5000/schedules');
            const data = await response.json();
            setSchedules(data);
        } catch (error) {
            console.error('Error fetching schedules:', error);
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('http://localhost:5000/schedules', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(newSchedule),
            });
            if (response.ok) {
                fetchSchedules();
                setNewSchedule({
                    name: '',
                    description: '',
                    url: '',
                    cronExpression: '',
                    method: 'GET',
                    headers: '',
                    body: ''
                });
            }
        } catch (error) {
            console.error('Error creating schedule:', error);
        }
    };

    const handleChange = (e) => {
        setNewSchedule({
            ...newSchedule,
            [e.target.name]: e.target.value
        });
    };

    return (
        <div className="schedules-container">
            <div className="page-header">
                <h1>Schedules</h1>
                <button className="create-button" onClick={() => document.getElementById('newScheduleForm').scrollIntoView({ behavior: 'smooth' })}>
                    Create Schedule
                </button>
            </div>

            <div className="content-section">
                <div className="section-header">
                    <h2>Existing Schedules</h2>
                </div>
                <div className="schedules-table">
                    <table>
                        <thead>
                            <tr>
                                <th>Name</th>
                                <th>Description</th>
                                <th>URL</th>
                                <th>Cron Expression</th>
                                <th>Method</th>
                                <th>Status</th>
                            </tr>
                        </thead>
                        <tbody>
                            {schedules.map((schedule) => (
                                <tr key={schedule.id}>
                                    <td>{schedule.name}</td>
                                    <td>{schedule.description}</td>
                                    <td>{schedule.url}</td>
                                    <td>{schedule.cronExpression}</td>
                                    <td>{schedule.method}</td>
                                    <td>
                                        <span className={`status-badge ${schedule.active ? 'active' : 'inactive'}`}>
                                            {schedule.active ? 'Active' : 'Inactive'}
                                        </span>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>

            <div className="content-section" id="newScheduleForm">
                <div className="section-header">
                    <h2>Create New Schedule</h2>
                </div>
                <form onSubmit={handleSubmit} className="schedule-form">
                    <div className="form-group">
                        <label htmlFor="name">Name</label>
                        <input
                            type="text"
                            id="name"
                            name="name"
                            value={newSchedule.name}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="description">Description</label>
                        <textarea
                            id="description"
                            name="description"
                            value={newSchedule.description}
                            onChange={handleChange}
                            rows="3"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="url">URL</label>
                        <input
                            type="url"
                            id="url"
                            name="url"
                            value={newSchedule.url}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="cronExpression">Cron Expression</label>
                        <input
                            type="text"
                            id="cronExpression"
                            name="cronExpression"
                            value={newSchedule.cronExpression}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="method">Method</label>
                        <select
                            id="method"
                            name="method"
                            value={newSchedule.method}
                            onChange={handleChange}
                        >
                            <option value="GET">GET</option>
                            <option value="POST">POST</option>
                            <option value="PUT">PUT</option>
                            <option value="DELETE">DELETE</option>
                        </select>
                    </div>

                    <div className="form-group">
                        <label htmlFor="headers">Headers (JSON)</label>
                        <textarea
                            id="headers"
                            name="headers"
                            value={newSchedule.headers}
                            onChange={handleChange}
                            rows="3"
                            placeholder="{\n  'Content-Type': 'application/json'\n}"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="body">Body</label>
                        <textarea
                            id="body"
                            name="body"
                            value={newSchedule.body}
                            onChange={handleChange}
                            rows="3"
                        />
                    </div>

                    <div className="form-actions">
                        <button type="submit" className="submit-button">Create Schedule</button>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default Schedules;
